package cn.com.phinfo.protocol;import com.heqifuhou.protocolbase.HttpResultBeanBase;import com.heqifuhou.protocolbase.QuickRunObjectBase;public class LoginRun extends QuickRunObjectBase {	public LoginRun(final String Username,final String Password) {		super(LURLInterface.GET_URL_LOGIN(Username,Password),null,LoginResultBean.class);	}	public static class LoginResultBean extends HttpResultBeanBase{		private String userid;		private String nickname;		private String userName;		private String access_token;		private String expires_in;		public String getUserid() {			return userid;		}		public void setUserid(String userid) {			this.userid = userid;		}		public String getNickname() {			return nickname;		}		public void setNickname(String nickname) {			this.nickname = nickname;		}		public String getUserName() {			return userName;		}		public void setUserName(String userName) {			this.userName = userName;		}		public String getAccess_token() {			return access_token;		}		public void setAccess_token(String access_token) {			this.access_token = access_token;		}		public String getExpires_in() {			return expires_in;		}		public void setExpires_in(String expires_in) {			this.expires_in = expires_in;		}	}}